import React from 'react';
import '../styles.css';

function Home() {
  return (
    <div className="main">
      <section>
        <h2>Bienvenido a la Gestión de Prácticas en Empresas</h2>
        <p>Aquí podrás gestionar los alumnos, empresas, candidatos y más</p>
      </section>
      <div className="extra-div">
        <img src="https://salesianosrioja.com/wp-content/uploads/2016/03/Logo-Salesianos_vertical.png" alt="Imagen Logo Salesianos" style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
      </div>
    </div>
  );
}

export default Home;
